import Navbar from "../../Components/Navbar/Navbar";
import "./Orders.css";

function Orders() {
  
  return (
    <div>
      <Navbar />
      <div className="head">
        <h2>Your Orders</h2>
        <input className="box" type="text" placeholder="Search" />
        <button>Search</button>
      </div>
      <div>

      </div>
    </div>
  );
}

export default Orders;
